import React, { Component } from 'react';
import SubMain from './SubMain'

class Main extends Component {
    state = { 
        persons: [
            {name:'John', age:26},
            {name:'Habib', age:25},
            {name:'Tonoy', age:22}
        ]
     }
    render() { 
        return ( 
           <div>
               <p>{this.state.name}</p>
              <SubMain name={this.state.name} />
           </div> 
         );
    }
}

export default Main;
